import React from 'react';


class Page1 extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
        }
    }

    handleSubmit = () => {
        this.props.history.push('/Page2')
    }

    render() {


        return (
            <div style={{textAlign:'center'}}>
                <label style={{ color: '#f36178', fontWeight: 'bold',fontSize:'30px' }}>Google Analytics</label><br /><br />
                <div className="md-form mt-0">
                    <i className="fa fa-search" aria-hidden="true"></i>
                    <input className="form-control form-control-sm ml-3 w-75" type="text" placeholder="Search"
                       style={{padding:'10px',borderRAppadius:'10px',border:'1px black solid'}} aria-label="Search" />
                </div><br /><br />
                <button style={{backgroundColor:'#8510d8',color:'#fff',padding:'10px',borderRadius:'10px',border:'none',cursor:'pointer'}} onClick={this.handleSubmit}>
                    Agriculture
                    </button><br/><br/>
                <button style={{backgroundColor:'#8510d8',color:'#fff',padding:'10px',borderRadius:'10px',border:'none',cursor:'pointer'}} onClick={this.handleSubmit}>
                    Industry
                    </button><br/><br/>
                <button style={{backgroundColor:'#8510d8',color:'#fff',padding:'10px',borderRadius:'10px',border:'none',cursor:'pointer'}} onClick={this.handleSubmit}>
                    Vehicles
                    </button><br/><br/>
                <button style={{backgroundColor:'#8510d8',color:'#fff',padding:'10px',borderRadius:'10px',border:'none',cursor:'pointer'}} onClick={this.handleSubmit} 
                >Health</button>
                <br/><br/>
            </div>

        )
    }
}
export default Page1;
